import React from 'react';
import { Box, Typography } from '@mui/material';

const HeaderLogo = ({ theme }) => {
    return (
        <Box sx={{
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            width: '100%',
            mb: theme.spacing(8),
            gap: theme.spacing(2),
            backgroundColor: 'rgba(255, 255, 255, 0.5)', // 添加半透明的白色背景
            padding: theme.spacing(2), // 添加一些内边距
            borderRadius: theme.shape.borderRadius, // 添加圆角以获得更柔和的外观
        }}>
            <img src={`${process.env.PUBLIC_URL}/LogoImage.jpg`} alt="Logo" style={{ width: 80, height: 'auto' }} />
            <Typography variant="h3" color="white" sx={{ fontWeight: 'bold' }}>
                Our Amazing Ticket Platform
            </Typography>
        </Box>
    );
};

export default HeaderLogo;
